import React from 'react';
import Grid from '@material-ui/core/Grid';
import MainControls from './MainControls';

function ControlPanel() {

    return(
        <Grid 
            container 
            spacing={0}
            direction="row"
            justify="center"
            align-items="center"
            style={{height: "100%"}}
        >
            <Grid item xs={4} style={{backgroundColor:"#abc123"}}>
            </Grid>
            <Grid item xs={4} md={3} lg={2} style={{backgroundColor:"#292f6a"}}>

                <Grid 
                    container 
                    spacing={0}
                    direction="row"
                >
                    <Grid item xs={12}>

                    </Grid>
                    <Grid item xs={12}>
                        <MainControls/>
                    </Grid>
                </Grid>
            </Grid>
            <Grid item xs={4} style={{backgroundColor:"#a1b2c3"}}>
            </Grid>
        </Grid>
    );
}

export default ControlPanel;
